import React from 'react';

// Styled JSX for consistent styling
const styles = `
  .game-container {
    background-color: #1c794c;
    display: flex;
    flex-direction: column;
    justify-content: center;
    padding: 44px 0;
  }

  .game-header {
    display: flex;
    flex-direction: column;
    overflow: hidden;
    position: relative;
    display: flex;
    min-height: 1029px;
    width: 100%;
    padding: 0 64px 50px;
  }

  @media (max-width: 991px) {
    .game-header {
      max-width: 100%;
      padding: 0 20px;
    }
  }

  .game-image {
    position: absolute;
    inset: 0;
    height: 100%;
    width: 100%;
    object-fit: cover;
    object-position: center;
  }

  .game-title-section {
    position: relative;
    justify-content: space-between;
    z-index: 10;
    display: flex;
    margin-top: -44px;
    gap: 20px;
    font-size: 72px;
    color: #fff;
    font-weight: 400;
  }

  @media (max-width: 991px) {
    .game-title-section {
      max-width: 100%;
      flex-wrap: wrap;
      font-size: 40px;
    }
  }

  .game-title {
    font-family: DM Serif Display, -apple-system, Roboto, Helvetica, sans-serif;
    flex-grow: 1;
    flex-basis: auto;
  }

  @media (max-width: 991px) {
    .game-title {
      max-width: 100%;
      font-size: 40px;
    }
  }

  .game-selection-section {
    position: relative;
    align-items: start;
    align-self: start;
    display: flex;
    gap: 7px;
    font-size: 80px;
    color: var(--lighter-green, #f2f9f6);
    font-weight: 700;
    margin: 32px 0 0 151px;
  }

  @media (max-width: 991px) {
    .game-selection-section {
      max-width: 100%;
      flex-wrap: wrap;
      font-size: 40px;
    }
  }

  .game-choices-container {
    position: relative;
    border-radius: 32px;
    background-color: var(--lighter-green, #f2f9f6);
    align-self: center;
    display: flex;
    width: 100%;
    max-width: 1361px;
    flex-direction: column;
    margin: 40px 0 64px;
    padding: 49px 57px;
  }

  @media (max-width: 991px) {
    .game-choices-container {
      max-width: 100%;
      margin-bottom: 40px;
      padding: 0 20px;
    }
  }

  .game-choices {
    display: flex;
    margin-top: 141px;
    align-items: start;
    justify-content: space-between;
    gap: 20px;
  }

  @media (max-width: 991px) {
    .game-choices {
      max-width: 100%;
      flex-wrap: wrap;
      margin-top: 40px;
    }
  }

  .confirm-selection {
    justify-content: center;
    border-radius: 20px;
    box-shadow: 0px 4px 4px 0px rgba(0, 0, 0, 0.25);
    background-color: #1c794c;
    align-self: center;
    margin-top: 121px;
    color: #fff;
    white-space: nowrap;
    padding: 33px 15px;
    font: 500 48px Roboto, sans-serif;
  }

  @media (max-width: 991px) {
    .confirm-selection {
      font-size: 40px;
      white-space: initial;
      margin-top: 40px;
    }
  }
`;

function GameChoice({ src, alt }) {
  return <img loading="lazy" src={src} alt={alt} className="game-image-choice" style={{ aspectRatio: '0.69', width: '127px', maxWidth: '100%' }} />
}

function TrainSelector() {
  const gameChoices = [
    { src: "https://cdn.builder.io/api/v1/image/assets/TEMP/d737771a839e9d3381cf8be0888aafeb9423dad94e31ce6e6b57702a2eb9bb23?apiKey=7293d20271ec4f72a58fe358903b4fd6&", alt: "Train Choice 1" },
    { src: "https://cdn.builder.io/api/v1/image/assets/TEMP/6f86f2b40e7a9d4e455f9a504dc5e366503ace6cf85fc3fb36aac70ac88a8fdf?apiKey=7293d20271ec4f72a58fe358903b4fd6&", alt: "Train Choice 2" },
    { src: "https://cdn.builder.io/api/v1/image/assets/TEMP/5ec4c3ceb8e14edecf8b637152c22aeb4571947ce4e06158fb90c3aa98a3f917?apiKey=7293d20271ec4f72a58fe358903b4fd6&", alt: "Train Choice 3" },
    { src: "https://cdn.builder.io/api/v1/image/assets/TEMP/b113a030456c013a7e21d15ec68b8ef946e9a436bdd585825811f93c41853999?apiKey=7293d20271ec4f72a58fe358903b4fd6&", alt: "Train Choice 4" },
    { src: "https://cdn.builder.io/api/v1/image/assets/TEMP/19af73f19f2af54ce737c599541168e9050396e728f163bd56c5c822021bf5ac?apiKey=7293d20271ec4f72a58fe358903b4fd6&", alt: "Train Choice 5" },
    { src: "https://cdn.builder.io/api/v1/image/assets/TEMP/2e707c1c15ef3106cc95045c56346e6166b027d11a3d59268444fa4919181093?apiKey=7293d20271ec4f72a58fe358903b4fd6&", alt: "Train Choice 6" }
  ];

  return (
    <>
      <style jsx>{styles}</style>
      <div className="game-container">
        <div className="game-header">
          <img loading="lazy" src="https://cdn.builder.io/api/v1/image/assets/TEMP/8dbca933ffcd089f07077f037b47f9d35112fe8982e429140eb2217b3c26466f?apiKey=7293d20271ec4f72a58fe358903b4fd6&" alt="Game Background" className="game-image" />
          <div className="game-title-section">
            <div className="game-title">Mexican Train Dominoes</div>
            <img loading="lazy" src="https://cdn.builder.io/api/v1/image/assets/TEMP/454567658b547d84431fbbdf8224a75d18594956415276dd425887318929e8c0?apiKey=7293d20271ec4f72a58fe358903b4fd6&" alt="Game Icon" className="game-icon" style={{ aspectRatio: '1.01', width: '80px', margin: 'auto 0' }} />
          </div>
          <div className="game-selection-section">
            <img loading="lazy" src="https://cdn.builder.io/api/v1/image/assets/TEMP/025477eabf784886eadb60c6ba12a0fec11935a51338f9020aed34c374c076aa?apiKey=7293d20271ec4f72a58fe358903b4fd6&" alt="Select Train" style={{ aspectRatio: '1.05', width: '98px' }} />
            <div className="choice-heading">Choose your train</div>
            <img loading="lazy" src="https://cdn.builder.io/api/v1/image/assets/TEMP/4f3dfe0c2a2570e365de2a0fd6e749da98786ab34b67c024779968de787f3a05?apiKey=7293d20271ec4f72a58fe358903b4fd6&" alt="Arrow right" style={{ aspectRatio: '1.05', width: '98px' }} />
          </div>
          <div className="game-choices-container">
            <div className="-choices">
              {gameChoices.map(choice => (
                <GameChoice src={choice.src} alt={choice.alt} key={choice.src} />
              ))}
            </div>
            <div className="confirm-selection">Confirm Selection</div>
          </div>
        </div>
      </div>
    </>
  );
}

export default TrainSelector;
